import React from "react";

import "../App.css";

const Auth = () => {
  return (
    <div className="wrapper">
      <div className="auth-info">
          Info
      </div>
      <div className="auth-form">
          <h2>Join Shocker Pools</h2>
          <form>
              <input type="text" placeholder="First Name" />
              <input type="text" placeholder="Last Name" />
              <input type="email" placeholder="Email Address" />
              <input type="password" placeholder="Password" />
              <p><input type="checkbox" className="auth-form-checkbox" /> I agree to the <u>Terms & Conditions</u></p>
              <input type="checkbox" className="auth-form-checkbox" /> I want to receive Shocker Pools newsletter
          </form>
      </div>
    </div>
  );
};

export default Auth;
